  `MIN_BAL_LMT` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '最小余额限额',
  `MIN_TRG_VAL` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '最低余额充值触发值',
  `BAL_TAG` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '余额TAG',
  `REV_AMT` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '收益',
  `TOT_REV_AMT` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '累计提取收益',
  `UPD_DT` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '最后记账日期',
  `UPD_JRN` varchar(18) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '最新更新流水号',
  `ORD_SEQ` bigint(20) NOT NULL DEFAULT 0 COMMENT '收支明细序号',
  `TM_SMP` varchar(26) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '时间戳',
  `FND_AC_NO` varchar(12) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '基金公司账号',
  `FND_CP_CD` varchar(6) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '基金产品编码',
  `CRE_TM` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '创建时间',
  `NOD_ID` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '节点ID',
  `REQ_ID` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '请求流水号',
  PRIMARY KEY (`AC_NO`, `CAP_TYP`, `CCY`, `AC_ORG`) USING BTREE,
  UNIQUE INDEX `T_ACM_CABL_PK`(`AC_NO`, `CAP_TYP`, `CCY`, `AC_ORG`) USING BTREE,
  INDEX `T_ACM_CABL_NI1`(`USR_NO`, `CAP_TYP`, `AC_TYP`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '余额理财交易账户余额表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for t_acm_cadt
-- ----------------------------
DROP TABLE IF EXISTS `t_acm_cadt`;
CREATE TABLE `t_acm_cadt`  (
  `SYS_DT` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '系统日期',
  `SYS_TM` varchar(6) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '系统时间',
  `JRN_NO` bigint(20) NOT NULL COMMENT '流水号',
  `JRN_SEQ` bigint(20) NOT NULL COMMENT '明细序号',
  `AE_SEQ` varchar(6) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '分录序号',
  `AC_NO` varchar(19) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '账号',
  `CAP_TYP` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '资金种类',
  `CCY` varchar(3) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '币种缺省为CNY',
  `AC_TYP` varchar(3) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '账户种类',
  `MAIN_CD_STS` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '账户收支状态  0-正常；1-已汇总入账',
  `OLD_TX_DT` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '原始交易日期   记录商户端发送过来的交易日期和时间；对于现场联机消费，则为C端日期和时间；对于远程交易，则为商户下单的日期和时间',
  `OLD_TX_TM` varchar(6) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '原始交易时间',
  `AC_DT` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '记账日期     为了保证内部总账的平衡检查，需要保留将每一笔动账明细归属的账务日期进行登记。',
  `RVS_TX_FLG` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '冲正交易标志   N：正常交易\r\nC：冲正交易\r\nR：撤销交易',
  `RVS_TX_TYP` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '冲正标志      N：正常\r\nC：被冲正\r\nR：被撤销',
  `RVS_JRN` bigint(20) NOT NULL DEFAULT 0 COMMENT '冲正流水号',
  `RVS_JRN_SEQ` bigint(20) NOT NULL DEFAULT 0 COMMENT '冲正流水明细序号',
  `TX_CD` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '交易码     代表原始交易的属性',
  `TX_TYP` varchar(2) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '交易类型',
  `BUS_TYP` varchar(4) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '业务子类型',
  `TX_OPP_TYP` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '交易对手类型    0：个人；1：商户；2：充值渠道；3：**',
  `TX_OPP_CD` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '交易对手编号    可以登记原始交易商户号等信息',
  `TX_OPP_NM` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '交易对手名称    登记原始交易商户名称、或者传输过来的商户名称等信息',
  `OPP_AC` varchar(19) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '对方账号',
  `DR_AMT` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '支出金额',
  `CR_AMT` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '收入金额',
  `OD_AMT` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '透支金额',
  `BAL` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '余额',
  `UPD_BAL_FLG` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '余额更新标志     0-已更新；1-未更新(日终统一更新)',
  `TX_DESC` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '交易描述         可以存放关键的的商品信息描述',
  `ORD_TYP` varchar(2) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '订单类型',
  `ORD_NO` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '内部订单编号    通过订单类型和内部订单编号，可以连接到订单的详细信息查询',
  `USR_NO` bigint(20) NOT NULL DEFAULT 0 COMMENT '内部用户号',
  `USR_PROV` varchar(2) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '用户归属省',
  `USR_CITY` varchar(4) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '用户归属市',
  `AC_PROV` varchar(2) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '账户归属省',
  `AC_CITY` varchar(4) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '账户归属市',
  `AC_ORG` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '账务归属机构',
  `TX_AMT` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '对应原始金额    消费金额或充值金额',
  `FEE_AMT` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '对应服务费     (仅针对商户消费入账时，才允许登记；即买方不需要登记；代理点充值亦类似)',
  `MERC_ID` varchar(15) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '入账商户号',
  `VCH_NO_TYP` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '传票号类型     0：交易流水号；1：普通BSP批次号；2日终清算批次号',
  `VCH_NO` varchar(18) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '传票号',
  `RMK` varchar(120) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '备注',
  `BUS_CNL` varchar(5) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '业务渠道',
  `SYS_CNL` varchar(5) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '系统渠道',
  `TM_SMP` varchar(26) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '时间戳',
  `TRM_LOG` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '终端流水号',
  `POS_TRM_ID` varchar(12) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '终端编号',
  `UAVA_BAL` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '不可用余额',
  `LAST_AVA_BAL` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '上日可用余额',
  `HOLD_AMT` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '冻结解冻金额',
  `HLD_NO` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '冻结编号',
  `HLD_DC_FLG` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '收支标志   D:借  C:贷  H：冻结  U：解冻',
  `NOT_TX_AMT` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '可用不可提现发生额',
  `USR_CITY_NM` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '用户归属城市名    用户实际归属的城市名称，如0731的湘潭',
  `ORD_SEQ` bigint(20) NOT NULL DEFAULT 0 COMMENT '订单序号',
  `NOD_ID` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '节点ID',
  `REQ_ID` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '请求流水号',
  `ORG_JRN_NO` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '发起系统流水号',
  `ORG_TX_DT` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '发起系统交易日期',
  PRIMARY KEY (`AC_DT`, `JRN_NO`, `JRN_SEQ`) USING BTREE,
  UNIQUE INDEX `T_ACM_CADT_PK`(`AC_DT`, `JRN_NO`, `JRN_SEQ`) USING BTREE,
  INDEX `T_ACM_CADT_NI1`(`AC_NO`, `OLD_TX_DT`) USING BTREE,
  INDEX `T_ACM_CADT_NI2`(`AC_DT`, `AC_TYP`, `CAP_TYP`) USING BTREE,
  INDEX `T_ACM_CADT_NI3`(`AC_NO`, `SYS_DT`) USING BTREE,
  INDEX `T_ACM_CADT_NI4`(`AC_NO`, `AC_DT`) USING BTREE,
  INDEX `T_ACM_CADT_NI5`(`USR_NO`, `SYS_DT`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '理财交易账户资金收支明细表' ROW_FORMAT = Dynamic;

